import {TASKS_LOADED, USERS_LOADED} from '../../constants';

export const usersLoaded = (users) => ({
  type: USERS_LOADED,
  users
});

export const usersError = (err) => ({
  type: ERR_
})


export const tasksLoaded = (tasks) => ({
  type: TASKS_LOADED,
  tasks
});
